function NavBar() {
    let linkedinUrl = 'https://www.linkedin.com/in/cole-kedzierski';
    return ( 
        <div>
            <span ><a class='navFonts' href={linkedinUrl} target='_blank' rel='noreferrer' >Linkedin</a></span>
        </div>

    );



}   export default NavBar;
